import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="nav-wrap">
          <nav className="navbar navbar-expand-lg navbar-color">
            <a className="navbar-brand head" href="#"><strong>Phoenix</strong></a>
          </nav>
        </div>
        <img src="https://melbournechapter.net/images/phoenix-svg-icon.png" className="App-logo" alt="logo" />
      </div>
    );
  }
}

export default App;
